import React, { Fragment } from "react";
import MyHeading,{MyHeadingLittle2 ,MyHeadingLittle3} from "./components/MyHeading";

const a = 20;

function App () {
  return (
    <Fragment>
      <div>
        <MyHeading name="gaurav" text="hello"/>
        <MyHeadingLittle2/>
        <MyHeadingLittle3 />
        <h1>Welcome page 1 {a}</h1>
      </div>
    </Fragment>
  );
}
export default App;
